import { useFetchTasksQuery } from "../../redux/tasks/slice";
import TaskItem from "./taskItem/TaskItem";

const TaskList = () => {
  const { data } = useFetchTasksQuery();
  console.log(data);
  return (
    <ul>
      {data.length > 0 &&
        data.map(({ id, completed, text }) => {
          return (
            <TaskItem key={id} id={id} completed={completed} text={text} />
          );
        })}
    </ul>
  );
};

export default TaskList;
